import { useState } from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import BasicExample from './Cards';
import Morpion from "/home/lako/document/site_portfolio/portfolio/src/images/morpion.png";
import Puissance4 from '/home/lako/document/site_portfolio/portfolio/src/images/puissance4.png'

function MyProjets() {
    return (
      <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src={Morpion} />
        <Card.Body>
          <Card.Title>Morpion</Card.Title>
          <Card.Text>
          Ce projet a été développé dans le cadre d'un projet scolaire pour créer une version du jeu "Puissance 4" avec une grille modulable.
          </Card.Text>
          <Button variant="primary">Lien Git</Button>
        </Card.Body>
      </Card>
    );
}

export default MyProjets;
